import React, { Component } from 'react'

export default class Square extends Component {
    constructor(props){
        super(props)
        this.state={
            value:"",
            squareList:[]
        }
    }
    render() {
        return (
            <div className="square" onClick={()=>this.props.selectSquare()}>
                {this.props.squareList[this.props.id]}
            </div>
        )
    }
}
